import React from 'react';

const SobreMim = () => {
    return (
        <section className="sobreMim">
            <h2>Sobre Mim</h2>
            <p>
                Sou uma desenvolvedora Back-End apaixonada por tecnologia, com experiência em Java, Node.js e outras tecnologias. Busco sempre oferecer soluções eficientes e inovadoras.
            </p>
        </section>
    );
};

export default SobreMim;
